import React from "react";
import ProjectCard from "../../components/ProjectCard";
import projects from "../../projects.json";
// import "./App.css";
import { Col, Row, Container, Wrapper } from "../../components/Grid";
import "./Projects.css"
import Nav from "../../components/Nav/"

class Projects extends React.Component {
  // Setting this.state.friends to the friends json array
  constructor(props) {
    super(props);
    this.state = {
      projects
    };
  }

  
  // Map over this.state.friends and render a FriendCard component for each friend object
  render() {
    return (
      <Container   style={{ background: "green" }} fluid>
      <Nav/>
      <div id={"projectContainer"}>
          <Row>
        <h1 size="md-3  sm-6 ">My Projects</h1>
        {this.state.projects.map(project => (
          
        <Col style={{display: "inline-block"}}
        size="md-10-offset-2  sm-12">                  
          <ProjectCard
            id={project.id}
            key={project.id}
            title={project.title}
            image={project.image}
            description={project.description}
            url={project.url}
          />
          <div style={{display: "inline-block",  paddingBottom:"25px"}}><p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vivamus feugiat odio dui, vel scelerisque lorem faucibus sit amet. Fusce sem dolor, d</p></div>
       
        </Col>
        ))}
        
        
        </Row>
        </div>
      </Container>
    );
  }
}

export default Projects;
